    public class GraficasController : Controller
    {
        // GET: Graficas
        [Authorize(Roles = "Administrador,Super Administrador")]
        public ActionResult Create()
        {

                return View();
        }

        [HttpPost]
        [Authorize(Roles = "Administrador,Super Administrador")]
        public FileResult DocumentoGeneral(string images64)
        {
            var image01 = Convert.FromBase64String("data:image/png;base64,");
            //var image02 = Convert.FromBase64String(images64[1]);


            iTextSharp.text.Image imgItext01 = iTextSharp.text.Image.GetInstance(image01);
            //iTextSharp.text.Image imgItext02 = iTextSharp.text.Image.GetInstance(image02);

            MemoryStream stream = new MemoryStream();

            Document document = new Document();

            document.SetMargins(0f, 0f, 0f, 0f);

            PdfWriter.GetInstance(document, stream).CloseStream = false;

            document.Open();
            document.Add(imgItext01);
            //document.Add(imgItext02);
            document.Close();

            byte[] byteImgInfo = stream.ToArray();
            stream.Write(byteImgInfo, 0, byteImgInfo.Length);

            return File(stream, "application/pdf",DateTime.Now.ToString());
        }


    }
}